Diagnosis.
A small slender 

Cyrtodactylus

with a maximum SVL of 
69 mm
, distinguished from all congeners by the combination of the following characters: 
1
) rounded body in cross-section, not depressed; 
2
) neck band extending to the posterior margin of the eye; 
3
) trunk, tail, and limbs bearing irregularly shaped bands (
4–6
on trunk, and 
4–12
across the tail); 
4
) tubercles present on the head, body, limbs and tail; 
5
) dorsal tubercles in 
16–22
irregular longitudinal rows; 
6
) ventrals in 
28–42
longitudinal rows at midbody; 
7
) lateral folds weakly developed or absent and lacking enlarged tubercles; 
8
) tail base bearing scales arranged in whorls, not depressed nor enlarged; 
9
) two or three postcloacal spurs in both males and females; 
10
) precloacal pores 
6–8
, in an angular row in males and a patch of enlarged precloacal scales in both sexes; 
11
) slightly enlarged femoral scales present in both males and females, numbering 
3–8
on each hindlimb; 
12
) femoral pores absent; 
13
) precloacal groove absent; 
14
) subcaudal scales not enlarged; 
15
) fourth toe with 
14–19
subdigital lamellae.

